import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar'; // Ensure this points to the correct file
import Home from './pages/Home'; // Ensure this points to the correct file
import About from './pages/About'; // Ensure this points to the correct file
import Artists from './pages/Artists'; // Ensure this points to the correct file
import Booking from './pages/Booking'; // Ensure this points to the correct file
import Contact from './pages/Contact'; // Ensure this points to the correct file
import AdminDashboard from './pages/AdminDashboard'; // Ensure this points to the correct file
import ProtectedRoute from './components/ProtectedRoute'; // Ensure this points to the correct file
import Login from './pages/Login'; // Import the Login component
function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/artists" element={<Artists />} />
        <Route path="/booking" element={<Booking />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/login" element={<Login />} /> {/* Add Login Route */}

        <Route
          path="/admin"
          element={
            <ProtectedRoute>
              <AdminDashboard />
            </ProtectedRoute>
          }
        />
      </Routes>
    </Router>
  );
}

export default App;
